import React, { Component } from "react";
import './css/style.css';
class Image extends Component {

    render() { 
        let imgArray= this.props.obj;
        return ( 
        <React.Fragment>
     {
            imgArray.map((value,index)=>

                <div id="img" key={index}>
                    <img style={{width:"300px", height:"500px",position: 'relative'}} src={value}  alt="Images"/>
                    <img src='/star.png' style={{bottom:0,right:0,  
                        width:"20px",height:"20px",position:'absolute'}}alt='star'/>
                </div>
            )
        }
        </React.Fragment>)

    }
}
export default Image;
